// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract CandidateRegistration {
    struct Candidate {
        uint id;
        string name;
        address walletAddress;
        uint electionId;
    }

    Candidate[] public candidates;
    mapping(address => bool) public hasRegisteredAsCandidate;
    uint public candidateCount;
    address public admin;
    bool public nominationOpen;

    event CandidateRegistered(uint id, string name, address walletAddress, uint electionId);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier duringNominationPeriod() {
        require(nominationOpen, "Nominations are closed");
        _;
    }

    modifier notAlreadyRegistered(address _candidate) {
        require(!hasRegisteredAsCandidate[_candidate], "Already registered as a candidate");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function toggleNomination(bool _status) external onlyAdmin {
        nominationOpen = _status;
    }

    function registerCandidateFor(address _candidate, string memory _name, uint _electionId)
        external
        onlyAdmin
        duringNominationPeriod
        notAlreadyRegistered(_candidate)
    {
        candidateCount++;
        candidates.push(Candidate(candidateCount, _name, _candidate, _electionId));
        hasRegisteredAsCandidate[_candidate] = true;

        emit CandidateRegistered(candidateCount, _name, _candidate, _electionId);
    }

    function getCandidatesByElectionId(uint _electionId) public view returns (Candidate[] memory) {
        uint count = 0;
        for (uint i = 0; i < candidateCount; i++) {
            if (candidates[i].electionId == _electionId) {
                count++;
            }
        }

        Candidate[] memory electionCandidates = new Candidate[](count);
        uint index = 0;
        for (uint i = 0; i < candidateCount; i++) {
            if (candidates[i].electionId == _electionId) {
                electionCandidates[index] = candidates[i];
                index++;
            }
        }

        return electionCandidates;
    }

    function isCandidate(address _candidate) external view returns (bool) {
        return hasRegisteredAsCandidate[_candidate];
    }
}

contracts/Election.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Election {
    address public admin;
    uint constant MINIMUM_REQUIRED_CANDIDATES = 2;

    struct ElectionData {
        bool started;
        bool ended;
        uint approvedCandidates;
    }

    mapping(uint => ElectionData) public elections;

    event ElectionStarted(uint electionId);
    event ElectionEnded(uint electionId);

    // Debug events for tracing
    event DebugMsg(string message, uint electionId);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier electionNotStarted(uint electionId) {
        require(!elections[electionId].started, "Election already started");
        _;
    }

    modifier electionOngoing(uint electionId) {
        require(elections[electionId].started && !elections[electionId].ended, "Election is not ongoing");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    function startElection(uint electionId, uint approvedCandidateCount) 
        public 
        onlyAdmin 
        electionNotStarted(electionId)
    {
        emit DebugMsg("startElection called", electionId);

        require(approvedCandidateCount >= MINIMUM_REQUIRED_CANDIDATES, "Not enough approved candidates to start election");
        emit DebugMsg("Approved candidate count sufficient", electionId);

        elections[electionId] = ElectionData({
            started: true,
            ended: false,
            approvedCandidates: approvedCandidateCount
        });
        emit DebugMsg("ElectionData updated", electionId);

        emit ElectionStarted(electionId);
        emit DebugMsg("ElectionStarted event emitted", electionId);
    }

    function endElection(uint electionId) 
        public 
        onlyAdmin 
        electionOngoing(electionId) 
    {
        elections[electionId].ended = true;
        emit ElectionEnded(electionId);
    }

   function getElectionStatus(uint electionId) public returns (string memory) {
    ElectionData memory election = elections[electionId];

    // Check if election data exists or not (based on default struct values)
    if (
        election.approvedCandidates == 0 &&
        election.started == false &&
        election.ended == false
    ) {
        emit DebugMsg("No election data found for electionId", electionId);
        return "No Election Found";
    }

    if (!election.started) {
        return "Not Started";
    } else if (!election.ended) {
        return "Ongoing";
    } else {
        return "Ended";
    }
}

}

contracts/VoterRegistration.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract VoterRegistration {
    struct Voter {
        string name;
        uint age;
        string gender;
        address voterAddress;
        bool isRegistered;
        bool hasVoted;
    }

    address public admin;
    uint public minimumAge = 18;
    mapping(address => Voter) public voters;
    address[] public voterAddresses;

    event VoterRegistered(address voterAddress, string name);
    event Voted(address voterAddress);

    modifier onlyAdmin() {
        require(msg.sender == admin, "Only admin can perform this action");
        _;
    }

    modifier notRegistered() {
        require(!voters[msg.sender].isRegistered, "You are already registered");
        _;
    }

    modifier isEligible(uint _age) {
        require(_age >= minimumAge, "You must be at least 18 years old to vote");
        _;
    }

    constructor() {
        admin = msg.sender;
    }

    



    function registerVoterFor(address _voter, string memory _name, uint _age, string memory _gender)
    external
    onlyAdmin
    isEligible(_age)
{
    require(!voters[_voter].isRegistered, "Voter already registered");

    voters[_voter] = Voter({
        name: _name,
        age: _age,
        gender: _gender,
        voterAddress: _voter,
        isRegistered: true,
        hasVoted: false
    });

    voterAddresses.push(_voter);
    emit VoterRegistered(_voter, _name);
}


    function markVoted(address _voter) external onlyAdmin {
        require(voters[_voter].isRegistered, "Voter not registered");
        require(!voters[_voter].hasVoted, "Already voted");
        voters[_voter].hasVoted = true;
        emit Voted(_voter);
    }

    function getVoter(address _voter) external view returns (Voter memory) {
        return voters[_voter];
    }

    function getAllVoters() external view returns (address[] memory) {
        return voterAddresses;
    }

    // âœ… Added this function for Voting contract compatibility
    function isRegistered(address _voter) external view returns (bool) {
        return voters[_voter].isRegistered;
    }
}

